@8bitdo ha anunciado nuevos mandos inspirados en la nueva Nintendo Switch Lite. Los controles en vez de tener dos joycon's, trae consigo dos d-pad's con el propósito de hacer muy delgado el mando. Los controles, a pesar de coincidir con el diseño de las nuevas consolas de Nintendo, también funcionan con Xbox, PC, MacOS, Android y demás dispositivos gracias a su conexiones Bluetooth y USB-C. Costarán $25 dólares y estarán disponibles el 30 de octubre. 
