🇬🇧 I’m clearly not a huge fan of football games, except the Fifa street franchise, I discovered it with the second episode, it was really fun to play it with friends. 6 years later the latest episode was released, unfortunately it lacks features such as the Game breaker but overall it’s really good as well ! .
🇫🇷Je ne suis clairement pas un grand fan de jeux de foot, hormis la série des Fifa street, j’ai découvert cette dernière grâce au second opus, je garde d’ailleurs de très bon souvenir de son multijoueur. 6 ans plus tard l’ultime volet de la franchise a été lancé, malheureusement il manque des features comme le gamebreaker, mais le jeu n’en demeure pas moins très bon ! .
